import React from "react";
import {Link, Route} from "react-router-dom";
import NavigationSidebar from "./NavigationSidebar/index"
import WhoToFollowListItem from "./WhoToFollowList/WhoToFollowListItem";
import WhoToFollowList from "./WhoToFollowList/index"
import PostSummaryItem from "./PostSummaryList/PostSummaryItem";
import PostSummaryList from "./PostSummaryList/index"
import ExploreComponent from "./ExploreScreen/ExploreComponent";
import ExploreScreen from "./ExploreScreen/ExploreScreen";
import who from "../../reducers/who";
import {createStore} from "redux";
import {Provider} from "react-redux";

const store = createStore(who);

const Tuiter = () => {
    return (
        <Provider store={store}>
            <div>
                <Route path="/tuiter"
                       exact={true} element={<WhoToFollowListItem/>}/>
                <Route path="/tuiter/explore"
                       exact={true} element={<ExploreScreen/>}/>
            </div>
        </Provider>

    )
};
export default Tuiter;


